import { useParams } from 'react-router-dom'

function Contact() {

    return (
        <div>
            <h4>샘플 페이지</h4>
            <h6>ID: 123</h6>
            <h6>Name: 김신하</h6>
            <h6>부서: 개발팀</h6>
            <h6>생일: 1999년 06월 13일</h6>
            <br />
        </div>

    )
}

export default Contact;
